import { mockData } from "../utils/mockData";

const ClientSlide=() =>{
return (
    <div>
        {mockData.map((card) => {
            return(
              <div>
             <h1>{card.id}</h1>
             {card.Image}
             {card.quoteIcon}
             <p>{card.para}</p>
             <h1>{card.name}</h1>
             <h3>{card.title}</h3>
             </div>
            )
        }
          )
          }
</div>
)
}
export default ClientSlide;
